import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <PageHead />
    </div>
  );
}

function PageHead() {
  return(
    <div class="App">
      <h1>Crypto Wallet</h1>
      <p>Latest BitCoin Price:</p>
      <p>Latest XRP Price:</p>
    </div>
  );
}

export default App;
